import React from "react";
import "./Navbar.scss";

export const Navbar: React.FC = () => {
  return (
    <div className="navbar">
      <div className="navbarContainer">
        <div className="leftMenu">
          <img className="navbarLogo" src="/images/logo.svg" />

          <div>Search</div>
          <div>Favorites</div>
        </div>
        <div className="rightMenu">
          <div>Sign out</div>
        </div>
      </div>
    </div>
  );
};
